import React, { Component } from 'react';

class InputTodo extends Component {
    state = {
        title: ''
    }
    render() { 
        return (
            <form>
                <input type='text' placeholder='What to do?' value={this.state.title}/>
                <button>Submit</button>
            </form>
        );
    }
}
 
export default InputTodo;
